import React, { Component } from 'react';
import "./styles.css";
import { useEffect, useState } from 'react';
import axios from 'axios';
import { useDispatch, useSelector } from "react-redux";
import { logout, selectUser } from "./features/userSlice";
import { useNavigate } from "react-router-dom";

function CreateTask() {
    const [taskTitle, settaskTitle] = useState('')
    const [taskDescription, settaskDescription] = useState('');
    const [taskAssignee, settaskAssignee] = useState(false);
    const [date_value, setdate_value] = useState(new Date());
    const user = useSelector(selectUser);
    const dispatch = useDispatch();
    let navigate = useNavigate();
    const loggedout = (e) => {
        dispatch(logout());
        navigate('/login');
      };
    function clickfn(e) {
        e.preventDefault();
        axios.post('http://localhost:8000/tasks/create', {
            title: taskTitle,
            description: taskDescription,
            assignee: taskAssignee,
            due_date: date_value,
            created_by: user.userid
        }, {
            headers:
            {
                'Authorization': "Bearer " + user.verifytoken
            }
        })
            .then(function (response) {

                alert("Task Created Succesfully");
                navigate("/dashboard");
            })
            .catch((error) => {

                if (error.response) {
                    if (error.response.data.error);
                    console.log(error.response.status);
                    console.log(error.response.headers);
                } else if (error.request) {
                    console.log(error.request);
                } else {
                    console.log('Error', error.message);
                }

            });
    }
    let xstyle = {
        borderRadius: "8px"
    };
    return (
        <div>
            <div className='navbary'>
                <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                    <a className="navbar-brand" href="#"><em>&nbsp;&nbsp;DeMock</em></a>
                    {/* <button className="navbar-toggler" type="button" dataToggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button> */}
                    {/* <div className="collapse navbar-collapse" id="navbarNavAltMarkup"> */}
                    <div className="navbar-nav">
                        <button className="myTasks nav-item nav-link" onClick={(e) => { navigate('/dashboard') }}><span style={{ color: "white" }}>Dashboard</span></button>
                        <button className="allUsers nav-item nav-link active" onClick={(e) => { navigate('/getallusers') }}><span style={{ color: "white" }}>Show All Users</span></button>
                        <p className="dis disabled" style={{ color: "white" }}>List Tasks</p>
                        <button className="crtTasks nav-item nav-link" onClick={(e) => { navigate('/create/task') }}><span style={{ color: "white" }}>Create Task</span></button>
                        <button className="logout nav-item nav-link" onClick={(e) => loggedout(e)}><span style={{ color: "white" }}>Logout</span></button>
                    </div>
                    {/* </div> */}
                </nav>
            </div>
            <form onSubmit={clickfn}>
                <label><b>Title </b></label>
                <input style={xstyle} onChange={(e) => { e.preventDefault(); const taskTitle = e.target.value; settaskTitle(taskTitle); }} placeholder="Title of the Task" type="text" required />

                <label><b>Description </b></label>
                <input style={xstyle} onChange={(e) => { e.preventDefault(); const taskDescription = e.target.value; settaskDescription(taskDescription); }} type="text" placeholder="Description of the Task" required />

                <label><b>Assignee</b></label>
                <input style={xstyle} onChange={(e) => { e.preventDefault(); const taskAssignee = e.target.value; settaskAssignee(taskAssignee); }} type="text" placeholder="Assignee" required />
                <label><b>Due Date &nbsp;</b></label>

                <input onChange={(e) => { e.preventDefault(); const newdateval = e.target.value; setdate_value(newdateval); }} type="date" id="duedate" name="duedate" />
                <button style={xstyle} type="submit">Create</button>
            </form>
        </div>
    )
}
export default CreateTask;
